  "hotcoinApp_v1_22245_TodaysProfitAndLoss_3": "Profits et pertes d'aujourd'hui = actifs totaux actuels de la devise au comptant - actifs initiaux d'aujourd'hui de la devise - transfert net entrant d'aujourd'hui + transfert net sortant d'aujourd'hui. \nCes données sont uniquement à titre de référence et il n'y a aucune garantie que les données soient absolument exactes. L'heure statistique est basée sur l'heure UTC+8, et 0-2 heures (UTC+8) chaque jour est l'heure de maintenance des données. . Les profits et pertes d'aujourd'hui ne seront pas affichés pendant cette période",
  "hotcoinApp_v1_22245_TodaysProfitAndLoss_2": "Profits et pertes d'aujourd'hui = bénéfice réalisé sur la commande d'aujourd'hui - frais de traitement d'aujourd'hui + frais de capital d'aujourd'hui - transfert net entrant + transfert net sortant d'aujourd'hui. \nCes données sont uniquement à titre de référence et il n'y a aucune garantie que les données soient absolument exactes. L'heure statistique est basée sur l'heure UTC+8, et 0-2 heures (UTC+8) chaque jour est l'heure de maintenance des données. . Les profits et pertes d'aujourd'hui ne seront pas affichés pendant cette période",
  "hotcoinApp_v1_22245_TodaysProfitAndLoss_1": "Profits et pertes d'aujourd'hui = actifs au comptant actuels - actifs initiaux d'aujourd'hui - transfert net d'entrée d'aujourd'hui + transfert net de sortie d'aujourd'hui. \nCes données sont uniquement à titre de référence et il n'y a aucune garantie que les données soient absolument exactes. L'heure statistique est basée sur l'heure UTC+8, et 0-2 heures (UTC+8) chaque jour est l'heure de maintenance des données. . Les profits et pertes d'aujourd'hui ne seront pas affichés pendant cette période",
  "hotcoinApp_v1_22245_DailyIncomeTotal": "Ingresos diarios = activos totales del día − activos iniciales del día − transferencias netas del día + transferencias netas del día. \nEstadísticas de datos de ingresos diarios: desde las 24:00 del día anterior hasta las 24:00 del día siguiente, de 0 a 3:00 (UTC+0) todos los días es el tiempo de mantenimiento de datos. Durante el mantenimiento de datos, las estadísticas pueden sufrir retrasos.",
  "hotcoinApp_v1_22245_TodaysProfitAndLoss": "Profits et pertes d’aujourd’hui = actif total global actuel − actifs initiaux d’aujourd’hui − transfert net d’entrée d’aujourd’hui + transfert net de sortie d’aujourd’hui. \nCes données sont uniquement à titre de référence et il n'y a aucune garantie que les données soient absolument exactes. L'heure statistique est basée sur l'heure UTC+8, et 0-2 heures (UTC+8) chaque jour est l'heure de maintenance des données. . Les profits et pertes d'aujourd'hui ne seront pas affichés pendant cette période",
  "hotcoinApp_v1_22_23_10HotcoinReservesThe": "Inilalaan ng Hotcoin ang huling karapatan na bigyang-kahulugan ang kaganapang ito, at inilalaan ng platform ang karapatang ayusin ang mga gawain at gantimpala anumang oras batay sa mga kondisyon ng merkado.",
  "hotcoinApp_v1_22_23_9IfAUser": "Если пользователь участвует в незаконных операциях, таких как мошенничество, регистрация машины или использует несколько учетных записей или несколько устройств для получения вознаграждений, платформа имеет право прекратить выдачу вознаграждений, заморозить незаконную учетную запись и связанные с ней учетные записи, а также оставляет за собой право далее привлечь к юридической ответственности.",
  "hotcoinApp_v1_22_23_8SomeUsersNeed": "Einige Benutzer müssen eine standardmäßige Identitätsüberprüfung durchführen, bevor sie sich für die Teilnahme an Aktivitäten und den Erhalt von Belohnungen anmelden können.",
  "hotcoinApp_v1_22_23_7TheDailyTask": "Die tägliche Aufgabenzeit ist von 00:00:00 bis 23:59:59 (UTC+8). Bitte erledigen Sie die Aufgabe innerhalb des Gültigkeitszeitraums und fordern Sie die Prämie noch am selben Tag an.",
  "hotcoinApp_v1_22_23_6AfterTheEvent": "Une fois l'événement terminé, il y aura une période de surveillance de 3 jours. Après la période de surveillance, le système délivrera automatiquement des récompenses au centre de bien-être et les utilisateurs devront collecter manuellement les récompenses par carte et par coupon.",
  "hotcoinApp_v1_22_23_5RewardsAreNot": "Ang mga gantimpala ay hindi pinagsama-sama. Ang mga reward na maaaring matanggap ng isang user ay nililimitahan alinsunod sa pinakamataas na antas ng mga kinakailangan na kanilang naabot.",
