  "hotcoinApp_v1_22_23_AfterSuccessfullyRegisteringAn": "1. Après avoir enregistré avec succès un compte, l'utilisateur doit remplir les conditions de recharge et de transaction dans les 30 jours pour être inclus dans le calcul de la récompense. Tout dépôt ou transaction effectué en dehors de cette période ne sera pas inclus dans le calcul de la récompense. 2. Dépôt net de l'utilisateur = montant du dépôt effectif pendant l'événement - tout montant retiré pendant l'événement. Les retraits comprennent : les retraits en chaîne, les ventes C2C, les transferts internes, les paiements par enveloppe rouge et les paiements. Les recharges en chaîne, les achats C2C, les recharges en monnaie tierce et fiduciaire sont toutes des recharges valides, et les transferts internes et les enveloppes rouges ne sont pas inclus. 3. Seules les transactions contractuelles sont incluses dans le montant de la transaction. Le trading à effet de levier au comptant, le trading de copie, etc. ne sont pas inclus dans le montant de la transaction de l'utilisateur. 4. Les données sur les dépôts nets et les transactions contractuelles sont mises à jour toutes les 30 minutes. 5. Les récompenses ne peuvent pas être accumulées. Les récompenses qu'un utilisateur peut recevoir sont plafonnées en fonction du niveau requis le plus élevé qu'il a atteint. 6. Une fois l'événement terminé, il y aura une période de surveillance de 3 jours. Après la période de surveillance, le système attribuera automatiquement des récompenses au centre de bien-être et les utilisateurs devront collecter manuellement les récompenses par carte et par coupon. 7. L'heure quotidienne de la tâche de récompense est de 00:00:00 à 23:59:59 (UTC+8). Veuillez terminer la tâche pendant la période de validité et réclamer la récompense le même jour. 8. Certains utilisateurs doivent effectuer une authentification d'identité standard avant de pouvoir s'inscrire pour participer à des activités et recevoir des récompenses. 9. Si un utilisateur se livre à des opérations illégales telles que la triche, l'enregistrement d'une machine ou utilise plusieurs comptes ou plusieurs appareils pour collecter des récompenses, la plateforme a le droit d'arrêter l'émission des récompenses, de geler les comptes illégaux et les comptes associés, et se réserve le droit pour poursuivre davantage la responsabilité juridique. 10. Le droit d'interprétation finale de cette activité appartient à Hotcoin, et la plateforme se réserve le droit d'ajuster les tâches et les récompenses à tout moment en fonction des conditions du marché.",
