  "Spot_v5_01_ForExample1InThe": "Ejemplo:1. En la imagen, el precio actual es $1000 (A), el precio de activación está establecido en $800 (B), el rango de devolución de llamada es 5% (C) y el precio del pedido es $900 (D), una orden de seguimiento de compra. .2. Cuando el precio suba, la orden de seguimiento de compra no tendrá efecto. Sólo cuando el precio baja alcanza o supera el precio de activación de $800 (B), se cumple una de las condiciones para la orden de seguimiento.3. Luego comience a monitorear el índice de rebote cuando el índice de rebote sea mayor o igual a la amplitud de devolución de llamada establecida del 5% (C), es decir, C = el precio de mercado más bajo * (1 + 5%), la segunda condición. del pedido de seguimiento también se cumple. Cuando se activa la orden, se ejecutará la orden limitada y el precio de la orden será $900 (D).",
  "Spot_v5_01_TheCurrentPriceIs": "Ang kasalukuyang presyo ay $1000 (A) Sa oras na ito, para sa susunod na order sa pagsubaybay, para sa direksyon ng pagbili, ang presyo ng pag-activate (B) ay dapat na mas mababa kaysa sa kasalukuyang presyo (A). Kung ang pinakamababang presyo ng merkado ay umabot o lumampas sa presyo ng activation (B), at ang kasunod na rebound ratio ay mas malaki kaysa o katumbas ng nakatakdang hanay ng callback (C), isang limitasyon o market order (D) ang ma-trigger.",
