  "Spot_v5_01_ActivationPrice_1": "presyo ng activation",
  "Spot_v5_01_TheCallbackRangeIs": "Trail Variance: The trail variance is a custom percentage & one of the triggering conditions that triggers the trailing stop order.When the activation price is satisfied, the trailing stop order will be executed if the trail variance of the market's highest/lowest price is greater than or equal to the pre-set variance percentage.{{color_0}}View More{{color_0}}",
  "Spot_v5_01_TheActivationPriceIs": "The activation price is the price & one of the triggering conditions that triggers the trailing stop order. If you don’t specify the activation price, this will default to the current Last Price . When a trailing stop order is placed,the market's highest/lowest price must reach or exceed the activation price in order to meet the condition.",
  "Spot_v5_01_TrackingOrdersReferTo": "Ang mga order sa pagsubaybay ay tumutukoy sa pagtatakda ng mga mangangalakal kapag umatras ang merkado.Ang order ay isinumite sa merkado bilang isang order ng diskarte. Kapag nakikipagkalakalan sa pinakabagong presyo sa merkadoPag-abot sa pinakamataas (pinakamababa) na presyong itinakda ng mangangalakal (1± hanay ng callback)Pagkatapos, ma-trigger ang pagpapatupad ng limitasyon o market order.",
  "Spot_v5_01_MarketOrder": "order sa pamilihan",
  "Spot_v5_01_At1001AnIOC": "A un precio de $1001, se completará una orden de compra del COI con una cantidad de 10.A un precio de $1001, una orden de compra de IOC con una cantidad de 30 se completará parcialmente, con una cantidad de transacción de 10, y la parte restante se cancelará inmediatamente.",
