  "region_10": "%Chg",
  "region_11": "Ang DeFi ay ang abbreviation ng Decentralized Finance (decentralized finance). Binibigyang-daan nito ang sinuman sa mundo na magsagawa ng mga aktibidad sa pananalapi anumang oras, kahit saan sa pamamagitan ng pagbuo ng isang desentralisadong protocol para sa isang bukas na sistema ng pananalapi. Ang DeFi ay nahahati sa maraming track, higit sa lahat: [Decentralized Lending] Magbigay sa mga user ng asset lending at borrowing services sa pamamagitan ng decentralized lending protocols. Ang mga user na may mga idle na asset ay maaaring makakuha ng kita sa pamamagitan ng pagpapahiram ng mga asset, at ang mga user na kailangang humiram ng mga asset ay maaaring humiram ng mga asset at magsagawa ng iba pang aktibidad sa pananalapi nang walang authentication. [Oracle] Nagbibigay ng benchmark na presyo para sa desentralisadong pagpapautang. Ang mga gumagamit na lumahok sa desentralisadong pagpapautang ay maaaring magpahiram o humiram batay sa presyo ng oracle machine, upang maiwasan ang paglihis ng presyo ng pautang mula sa normal na presyo sa pamilihan at magdulot ng mga pagkalugi. [Decentralized Exchange (DEX)] Isang exchange na maaaring ipagpalit nang walang pagpaparehistro. Kung ikukumpara sa mga sentralisadong palitan, ang mga desentralisadong palitan ay mas hindi nakikilala. Gayunpaman, ang antas ng pagkatubig ay mas mahina kaysa sa mga sentralisadong palitan.",
  "region_12": "NFT est l'abréviation de (Non Fungible Token). La plus grande caractéristique de celui-ci est que NFT n'est pas interchangeable et que chaque jeton est différent. L'une des origines de NFT remonte au jeu CryptoKitties en 2017, qui est utilisé pour représenter les différentes couleurs, gènes, générations et autres informations appartenant à chaque chat. À l'heure actuelle, NFT est principalement utilisé pour crypter l'émission et la circulation d'œuvres d'art, de terrains virtuels, d'accessoires de jeu, de billets et d'autres domaines. Tous les projets inclus dans la zone NF ne sont pas des jetons non fongibles, et certains sont des infrastructures prenant en charge NFT.",
  "region_13": "Polkadot ECO fait référence à l'écologie de la blockchain basée sur la chaîne commune Polkadot. Polkadot est conçu pour connecter des chaînes privées et de consortium, des réseaux publics et sans autorisation. Polkadot facilite un Internet où des chaînes de blocs indépendantes peuvent échanger des informations et des transactions sans confiance via la chaîne de relais Polkadot. Polkadot facilite plus que jamais la création et la connexion d'applications, de services et d'institutions décentralisés.",
  "region_14": "El almacenamiento descentralizado es un modelo comercial de almacenamiento que utiliza tecnología de almacenamiento distribuido para almacenar archivos en métodos de fragmentación en el espacio en disco proporcionado por diferentes proveedores. El almacenamiento distribuido es una tecnología de almacenamiento de datos que almacena datos en múltiples máquinas y equipos independientes, y realiza el almacenamiento redundante de datos a través de la tecnología de código de borrado. Tiene las ventajas de la protección de la privacidad, bajo costo de almacenamiento, almacenamiento de respaldo de datos redundantes, aplicaciones de código abierto y algoritmos, lo que es propicio para la transmisión de valor de los datos y evitar un solo punto de falla.",
  "region_15": "Ang Layer 2 ay isang solusyon na ginagamit upang malutas ang mga problema ng pagsisikip ng transaksyon ng Ethereum at mataas na mga bayarin sa gas. Sa kasalukuyan, mayroong ilang mga paraan ng pagpapatupad tulad ng rollup, state channel, at side chain. Ang tagapagtatag ng Ethereum ay nag-publish din ng ilang beses, na naniniwala na ang Layer 2 ay ang pinakamahusay na paraan upang malutas ang kasalukuyang mga problema sa pagganap ng Ethereum bago ang opisyal na paglulunsad ng Ethereum 2.0.",
  "region_16": "Le Metaverse est une plate-forme d'hébergement d'activités virtuelles avec des valeurs d'actifs de confiance et une authentification d'identité, qui permet la réplication de la logique sous-jacente du monde réel. L'essence du métaverse est une plate-forme qui peut transporter toutes les activités virtuelles, dans laquelle les utilisateurs peuvent mener des activités sociales, de divertissement, de création, d'affichage, d'éducation, de transaction et autres. Cela aura un impact et un changement subtils sur la production et le mode de vie des utilisateurs. Le métaverse a les points suivants : 1. Valeur d'actif de confiance ; 2. L'authentification de l'identité peut être effectuée ; 3. C'est une réplique du monde virtuel à tous les styles de production et de vie du monde physique.",
  "region_17": "Metaverse (Metaverse)",
