  "chargeback_documentarySet_020": "Ang nakapirming halaga at order ay kumakatawan sa gastos ng margin ng bawat order. Kung itinakda mo ang BTC/USDT Permanent Fixed Follow -Up na halaga ay 50USDT, kapag binuksan ng negosyante ang posisyon, gagamitin mo ang isang 50USDT margin upang sundin ang order.",
