  "swaps_583": "presyo ng activation",
  "swaps_584": "Kumpletuhin ang lahat ng mga transaksyon o kanselahin kaagad (F0K)",
  "swaps_585": "A fill or kill (FOK) order is a conditional order requiring the transaction to be executed immediately,otherwise the order must be automatically canceled (kill) right away.",
  "swaps_586": "Isagawa kaagad ang transaksyon at kanselahin ang natitira (IOC)",
  "swaps_587": "Immediate or Cancel (IOC) orders attempt to execute immediately and cancel any unfilled portion.",
  "swaps_588": "Cette commande est toujours en statut de commande en attente. Si le système détermine que l'ordre sera exécuté immédiatement avec l'ordre existant, il annulera automatiquement l'ordre.",
  "swaps_589": "napapanahon",
  "swaps_590": "เครื่องหมาย",
  "swaps_591": "A trailing stop order is a stop order that tracks the market price and allows you to predefine a constant or percentage.When the market price reaches / the predefined point, a market order is automatically executed.The order is activated only if the Last Price (Mark Price) reaches or exceeds the activation price. After the activation of the order, the actual Activation Price will be calculated by system automatically . If the user does not enter an Activation Price, system will automatically activate the trailing stop order after it is placed.",
  "swaps_592": "Stratégie de commande",
  "swaps_593": "Ang market order ay tumutukoy sa mabilis na pagbili at pagbebenta batay sa kasalukuyang pinakamahusay na presyo sa merkado.",
  "swaps_594": "Hình minh họa",
  "swaps_595": "Descripción de la escena:",
  "swaps_596": "Si el precio de mercado actual es de 1.000 dólares, una orden de mercado de compra o venta se ejecutará en alrededor de 1.000 dólares.",
  "swaps_597": "Tandaan: Depende sa direksyon ng pagbili at pagbebenta, ang average na presyo ng transaksyon ay maaaring bahagyang mas mataas o mas mababa sa $1,000 para sa mga order sa pagbili sa merkado, ang average na presyo ng transaksyon ay bahagyang mas mataas kaysa sa kasalukuyang presyo, at para sa mga order sa pagbebenta sa merkado, ang average na transaksyon; ang presyo ay bahagyang mas mababa kaysa sa kasalukuyang presyo.",
  "swaps_598": "Ang limitasyon ng order ay tumutukoy sa pagbili at pagbebenta sa isang limitado o mas mahusay na presyo, at ang mga limitasyon ng order ay hindi garantisadong isasagawa.",
  "swaps_599": "Ilustrasyon (pagkuha ng pagbili bilang isang halimbawa)",
  "swaps_600": "Kung ang kasalukuyang presyo sa merkado ay $1000, ang limit order na bumili sa $900 ay isasagawa lamang kung ang market ay bumaba sa $900 o mas mababa.",
  "swaps_601": "Kung ang kasalukuyang presyo sa merkado ay $1000, ang limit order na binili sa $1100 ay isasagawa sa humigit-kumulang $1000 sa halip na $1100, na tinitiyak ang pagpapatupad sa mas magandang presyo.",
  "swaps_602": "L'ordre limité avancé est un type d'ordre limité, comprenant trois mécanismes efficaces : Maker uniquement (uniquement les ordres en attente), exécution complète ou annulation immédiate (FOK) et exécution et annulation immédiates du reste (IOC).",
  "swaps_603": "Tanging ang mga tagubilin ng Maker diagram (pagkuha ng pagbili bilang isang halimbawa)",
  "swaps_604": "Se o preço de mercado atual for de US$ 1.000, uma ordem de compra \"Somente Maker\" de US$ 900 será inserida no livro de pedidos. Um pedido de compra \"Somente para Fabricante\" de US$ 1.100 pode ser combinado com um pedido existente e o pedido será cancelado.",
  "swaps_605": "Ilustrasyon ng FOK&IOC (ginagawa ang pagbili bilang halimbawa)",
  "swaps_606": "Si le prix actuel du marché est de 1 000 $, le prix de l'ordre de vente le plus bas est de 1 001 $ et la quantité est de 10.",
  "swaps_607": "Completar o cancelar inmediatamente (FOK):",
  "swaps_608": "Ao preço de US$ 1.001, uma ordem de compra FOK com quantidade de 10 será atendida. No entanto, a ordem de compra FOK com uma quantidade de 30 a um preço de US$ 1.001 não será concluída, portanto, tudo será cancelado.",
  "swaps_609": "Exécuter immédiatement et annuler le reste (IOC) :",
  "swaps_610": "Ao preço de US$ 1.001, uma ordem de compra do COI com uma quantidade de 10 será atendida.",
  "swaps_611": "A un precio de $1001, una orden de compra del COI con una cantidad de 30 se completará parcialmente, con una cantidad de transacción de 10, y la parte restante se cancelará inmediatamente.",
  "swaps_612": "Ang mga naka-iskedyul na order ay nagbibigay-daan sa mga mangangalakal na magtakda ng target na presyo nang maaga, at kapag naabot lang ang presyong iyon, ang limitasyon o market order ay ma-trigger.",
  "swaps_613": "Kung ang kasalukuyang presyo sa merkado ay $1000, ang isang naka-iskedyul na order na may trigger na presyo na $1100 ay ma-trigger kapag ang presyo sa merkado ay tumaas sa $1100, at isang katumbas na presyo sa merkado o limit order ay bubuo.",
  "swaps_614": "Ang mga order sa pagsubaybay ay tumutukoy sa mga madiskarteng order na nagsusumite ng mga order na itinakda ng mga mangangalakal sa merkado kapag umatras ang merkado. Kapag ang pinakahuling presyo (markahan ang presyo) ng trading market ay umabot sa (1 ± callback range) ang pinakamataas (pinakamababa) na presyong itinakda ng trader, ang execution ng market order ay ma-trigger.",
  "swaps_615": "The activation price is the price & one of the triggering conditions that triggers the trailing stop order. If you don’t specify the activation price, this will default to the current Last Price . When a trailing stop order is placed,the market's highest/lowest price must reach or exceed the activation price in order to meet the condition.",
  "swaps_616": "Trail Variance: The trail variance is a custom percentage & one of the triggering conditions that triggers the trailing stop order.When the activation price is satisfied, the trailing stop order will be executed if the trail variance of the market's highest/lowest price is greater than or equal to the pre-set variance percentage.",
  "swaps_617": "Ang kasalukuyang presyo ay $1000 (A) Sa oras na ito, para sa susunod na order sa pagsubaybay, para sa direksyon ng pagbili, ang presyo ng pag-activate (B) ay dapat na mas mababa kaysa sa kasalukuyang presyo (A). Kung ang pinakamababang presyo ng merkado ay umabot o lumampas sa presyo ng activation (B), at ang kasunod na rebound ratio ay mas malaki kaysa o katumbas ng nakatakdang hanay ng callback (C), ang market order (D) ay ma-trigger.",
  "swaps_618": "Halimbawa:",
  "swaps_619": "1. As shown in the figure, assume the market price is $1000 （A）, this is a \"buy\" trailing stop order with the activation price set up to $ 800 （B）, the trail variance is pre-set as 5% （C）.",
  "swaps_620": "2. Lorsque le prix augmente, l'ordre de suivi d'achat ne prendra pas effet. Ce n'est que lorsque la baisse du prix atteint ou dépasse le prix d'activation de 800 $ (B) que l'une des conditions de l'ordre suiveur est remplie.",
  "swaps_621": "3. Luego comience a monitorear el índice de rebote cuando el índice de rebote sea mayor o igual a la amplitud de devolución de llamada establecida del 5% (C), es decir, C = el precio de mercado más bajo * (1 + 5%), la segunda condición. También se cumple el plazo del pedido de seguimiento. Cuando se active la orden, se ejecutará la orden de mercado.",
